import * as React from "react";
import { Layout } from "../components";

export default function About() {
  class Bruh {
    boy: number;
    constructor() {
      this.boy = 0;
    }
    async countup() {
      this.boy++;
    }
  }

  function callBruh() {
    const response = new Bruh();
    response.countup();
    return response.boy;
  }

  console.log(callBruh());
  return (
    <Layout>
      <main>My about page</main>
    </Layout>
  );
}
